import React from "react";
import Navigation from "../components/Navigation";
import Hero from "../components/Hero";

const Home = () => {
  return (
    <div className="Homepage">
      <Navigation />
      <Hero />
      <button>
        <a href="/signin">Join us now !</a>
      </button>
    </div>
  );
};

export default Home;
